import {useEffect} from 'react'

function FetchEMA30Calculation({stockCode, onEMA30CalculationFetch}) {
    useEffect(() => {
        if(stockCode) {
            fetch(`http://127.0.0.1:8000/api/calculation_ema30/${stockCode}/`)
                .then(response => response.json())
                .then(data => {if(onEMA30CalculationFetch) onEMA30CalculationFetch(data)})
                .catch(error => console.error('Error Stock Data:', error));
        }
    }, [stockCode]);
    return null;
}
export default FetchEMA30Calculation;
